INSERT INTO `articles` VALUES (5,'Căn hộ SAFIRA Khang Điền Quận 9','can-ho-safira-khang-dien-quan-9','can ho safira khang dien quan 9','<strong><span style=\"font-size:18px;\">TH&Ocirc;NG TIN DỰ &Aacute;N CĂN HỘ SAFIRA</span></strong>\r\n<hr />\r\n<ul>\r\n	<li>Chủ đầu tư : C&ocirc;ng ty Khang Điền</li>\r\n	<li>Vị tr&iacute; căn hộ: Mặt tiền đường N6 (lộ giới 20m) kết nối v&agrave;o đường N5 (lộ giới 20m) tiếp gi&aacute;p đường V&otilde; Ch&iacute; C&ocirc;ng, phường Ph&uacute; Hữu, quận 9, TPHCM.</li>\r\n	<li>Tổng diện t&iacute;ch: 2,7 ha, bao gồm 4 Block, 8 th&aacute;p, cao 22 tầng, 2 tầng hầm.</li>\r\n	<li>Quy m&ocirc;: Khối th&aacute;p gần 32%</li>\r\n	<li>Mật độ x&acirc;y dựng: 1570 căn hộ + 23 TMDV</li>\r\n	<li>Loại căn hộ: 1 Ph&ograve;ng ngủ +1: 310 căn (khoảng 50 m2)</li>\r\n</ul>\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2 ph&ograve;ng ngủ: 1050 căn (khoảng 65 m2)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3 ph&ograve;ng ngủ: 184 căn (khoảng 80 m2) +&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TMDV: 26 căn<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Duplex: 21 căn\r\n<ul>\r\n	<li>Đơn vị x&acirc;y dựng dự &aacute;n: C&ocirc;ng ty An Phong.</li>\r\n	<li>Đơn vị quản l&yacute; dự &aacute;n: CBRE</li>\r\n	<li>Đơn vị tư vấn thiết kế: Accco</li>\r\n	<li>Đơn vị thiết kế &yacute; tưởng: Ong &amp; Ong</li>\r\n	<li>Thời gian mở b&aacute;n v&agrave; đặt chỗ:&nbsp; Th&aacute;ng&nbsp;11 năm 2018</li>\r\n	<li>Ph&aacute;p l&yacute; sử dụng: Sổ hồng, sở hữu l&acirc;u d&agrave;i.</li>\r\n</ul>\r\n','SAFIRA - Dự án mới nhất của Khang Điền tại quận 9. SAFIRA - Hội tụ những thế mạnh cộng hưởng từ vị trí, tiện ích nội khu và cảnh quan xung quanh, uy tín chủ đầu tư, cộng đồng  dân cư…\r\n','0938.399.647 (Ms. Thu Hương)',NULL,58,'<h2 class=\"page-title\"><span style=\"font-size:18px;\"><strong>Vị Tr&iacute;</strong></span></h2>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px;\">Safira tọa lạc mặt tiền đường N6 (lộ giới 20m) kết nối v&agrave;o đường N5 (lộ giới 20m) tiếp gi&aacute;p đường V&otilde; Ch&iacute; C&ocirc;ng. Ngay g&oacute;c cao tốc TP.HCM &ndash; Long Th&agrave;nh &ndash; Dầu Gi&acirc;y.</span></li>\r\n	<li><span style=\"font-size:14px;\">Safira liền kề khu d&acirc;n cư cao cấp Lucasta v&agrave; Khu d&acirc;n cư hiện hữu Mega Residence, Mega Ruby, Lucasta&hellip;</span></li>\r\n	<li><span style=\"font-size:14px;\">Dự kiến Qu&yacute; 3/2018 đường Song H&agrave;nh cao tốc Long Th&agrave;nh &ndash; Dầu Gi&acirc;y sẽ đưa v&agrave;o hoạt động. R&uacute;t ngắn thời gian di chuyển từ Safira đến đường Mai Ch&iacute; Thọ tầm 10 ph&uacute;t.</span></li>\r\n	<li><span style=\"font-size:14px;\">Đường cao tốc Long Th&agrave;nh Dầu Gi&acirc;y hiện hữu gi&uacute;p kết nối về S&acirc;n bay quốc tế Long Th&agrave;nh trong tương lai. R&uacute;t ngắn thời gian di chuyển đến c&aacute;c tỉnh ven biển như Vũng t&agrave;u, Phan Thiết, Nha Trang,&hellip;vv</span></li>\r\n	<li><span style=\"font-size:14px;\">Đường Li&ecirc;n Phường nối d&agrave;i đoạn từ Đỗ Xu&acirc;n Hợp đến ng&atilde; 3 C&aacute;t L&aacute;i, đi qua khu S&acirc;n Golf Rạch Chiếc cũ v&agrave; dự &aacute;n S&agrave;i G&ograve;n Sport City. Dự kiến sẽ triển khai trong thời gian sắp tới, gi&uacute;p r&uacute;t ngắn thời gian di chuyển từ Quận 9 về Cầu S&agrave;i G&ograve;n tầm 10-15 ph&uacute;t.</span></li>\r\n	<li><span style=\"font-size:14px;\">Đường V&agrave;nh Đai 2 đoạn từ Khu c&ocirc;ng nghệ cao đến Cầu Ph&uacute; Mỹ v&agrave;o Ph&uacute; Mỹ Hưng đ&atilde; hiện hữu. Đoạn từ Cầu Ph&uacute; Hữu đến ng&atilde; 4 B&igrave;nh Th&aacute;i dự kiến sẽ kh&eacute;p k&iacute;n trong thời gian tới.</span></li>\r\n	<li><span style=\"font-size:14px;\">Vị tr&iacute; dự &aacute;n Safira nằm gần c&aacute;c Cụm đ&ocirc; thị lớn tại Quận 2 như: KĐT Nam Rạch Chiếc &ndash; Khu li&ecirc;n hợp thể thao Nam Rạch Chiếc &ndash; Dự &aacute;n S&agrave;i G&ograve;n Sport City v&agrave; Dự &aacute;n 300 tại khu s&acirc;n Golf Rạch Chiếc cũ. Tất cả c&aacute;c dự &aacute;n đều đang được khởi c&ocirc;ng rầm rộ v&agrave; sẽ l&agrave; những khu đ&ocirc; thị kiểu mẫu của th&agrave;nh phố trong tương lai.</span></li>\r\n	<li><span style=\"font-size:14px;\">Ngo&agrave;i ra, khu căn hộ Safira nằm liền kề Khu c&ocirc;ng nghệ cao Quận 9 với hơn 300.000 kỹ sư, chuy&ecirc;n gia trong v&agrave; ngo&agrave;i nước đang l&agrave;m việc tại c&aacute;c c&ocirc;ng ty lớn như Samsung, Intel, Coca-cola,&hellip;B&ecirc;n cạnh đ&oacute;, dự &aacute;n Safira nằm cạnh c&aacute;c dự &aacute;n đ&atilde; triển khai động thổ như: Trường đại học Nguyễn Tất Th&agrave;nh, Trường đại học FPT, Trường đại học Fulbright v&agrave; Học viện H&agrave;ng kh&ocirc;ng Vietjet, Saigon Silicon Center.</span></li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Vi%20tri/vi-tri-edit1-1538625910.jpg\" style=\"max-width: 100%;\" /><br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><br />\r\n&nbsp;</p>\r\n','<p class=\"text-left\"><span style=\"font-size:18px;\"><strong>Tiện &iacute;ch</strong></span></p>\r\n\r\n<ul>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Hồ bơi tr&agrave;n với gần 1000 m2 diện t&iacute;ch</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Khu vui chơi trẻ em</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Đường chạy bộ ven s&ocirc;ng</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Shop house nội khu</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Shop house ven s&ocirc;ng</span></li>\r\n</ul>\r\n\r\n<div class=\"text-center\">\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Tien%20ich/tien-tich-collect-1538624872.jpg\" style=\"max-width: 100%;\" /></p>\r\n</div>\r\n\r\n<p class=\"text-center\">&nbsp;</p>\r\n\r\n<div class=\"text-center\">&nbsp;</div>\r\n','<p class=\"text-left\"><span style=\"font-size:18px;\"><strong>Mặt Bằng Căn Hộ</strong></span><br />\r\n<span style=\"font-size:14px;\">Thiết kế X&acirc;y dựng căn hộ Khang Điền SaFira : 4 Th&aacute;p mỗi th&aacute;p 22 tầng &ndash; Mỗi tầng 10-&gt;11 căn &ndash; 2 tầng hầm khối đế chung (Tầng 1: kh&ocirc;ng gian đa chức năng, Tầng 2: Nh&agrave; trẻ + Thương mại, Tầng 3-21: căn hộ ở &ndash; Tầng 22: Kỹ thuật).</span></p>\r\n\r\n<ul>\r\n	<li class=\"text-left\">Block A tổng c&oacute; 296 căn, 32 căn 1PN từ 45.4-52m2, 213 căn 2PN từ 59.8-71.5m2, 51 căn 3PN từ 81.6-88.1m2, Shophouse 6 căn.</li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Block B tổng c&oacute; 399 căn, 95 căn 1PN từ 45.4-52m2, 247căn 2PN từ 59.8-71.5m2, 57 căn 3PN từ 81.6-88.1m2. Duplex 9 căn, Shophouse 4căn.</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Block C tổng c&oacute; 399 căn, 75 căn 1PN từ 45.4-52m2, 285 căn 2PN từ 59.8-71.5m2, 38 căn 3PN từ 81.6-88.1m2, Duplex 15 căn</span></li>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Block D tổng c&oacute; 450 căn, 107 căn 1PN từ 45.4-52m2, 305căn 2PN từ 59.8-71.5m2, 38 căn 3PN từ 81.6-88.1m2. Duplex 1 căn. Shophouse 11 căn.</span></li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/mb-t3-4-21-block-cx-1538627362.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/mb-t3-4-16-block-dx-1538627362.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/mb-t2-17-21-block-dx-1538627362.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\">&nbsp;</p>\r\n\r\n<p class=\"text-center\">&nbsp;</p>\r\n\r\n<p class=\"text-center\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Căn hộ 1 ph&ograve;ng ngủ loại 1 + 1</span></li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/1-phong-ngu-11x-1538638343.JPG\" style=\"max-width: 100%;\" /></p>\r\n\r\n<ul>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Căn hộ 2 ph&ograve;ng ngủ</span></li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/2-phong-ngux-1538638343.JPG\" style=\"max-width: 100%;\" /></p>\r\n\r\n<ul>\r\n	<li class=\"text-left\"><span style=\"font-size:14px;\">Căn hộ 3 ph&ograve;ng ngủ</span></li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Can%20Ho/3-phong-ngux-1538638343.JPG\" style=\"max-width: 100%;\" /></p>\r\n','<br />\r\n<span style=\"font-size:18px;\"><strong>Tiến độ thi c&ocirc;ng đến th&aacute;ng 09/2018</strong></span>\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Tien%20ho%20thi%20cong/tien-do-collect-1538637143.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><u><strong>PHƯƠNG THỨC THANH TO&Aacute;N CHUẨN (Dự kiến)</strong></u></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/pttt-1538555677.JPG\" style=\"max-width: 100%;\" /></p>\r\n\r\n<div style=\"text-align: center;\"><u><strong>C&Aacute;C TRƯƠNG TR&Igrave;NH HỖ TRỢ T&Agrave;I CH&Iacute;NH (Dự kiến)</strong></u></div>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/httc-1538555789.JPG\" style=\"max-width: 100%;\" /></p>\r\n\r\n<div style=\"text-align: center;\"><u><strong>CHIẾT KHẤU THANH TO&Aacute;N NHANH (Dự kiến)</strong></u></div>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/ckttn-1538555934.JPG\" style=\"max-width: 100%;\" /></p>\r\n\r\n<div style=\"text-align: center;\"><u><strong>CHIẾT KHẤU THANH TO&Aacute;N NHANH</strong></u></div>\r\n\r\n<div style=\"text-align: center;\">(Đối với kh&aacute;ch h&agrave;ng c&oacute; nguốn tiền nh&agrave;n rỗi)\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/ckttn2-1538556268.JPG\" style=\"max-width: 100%;\" /></p>\r\n<u><strong>CHIẾT KHẤU THANH TO&Aacute;N NHANH</strong></u><br />\r\nChi tiết c&aacute;c đợt thanh to&aacute;n như sau:\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/ckttn3-1538556377.JPG\" style=\"max-width: 100%;\" /></p>\r\n<u><strong>CHIẾT KHẤU THANH TO&Aacute;N NHANH</strong></u><br />\r\n(Đối với kh&aacute;ch h&agrave;ng cần vay ng&acirc;n h&agrave;ng)\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/ckttn4-1538556464.JPG\" style=\"max-width: 100%;\" /></p>\r\n<u><strong>CHƯƠNG TR&Igrave;NH HỖ TRỢ L&Atilde;I SUẤT LI&Ecirc;N NG&Acirc;N H&Agrave;NG</strong></u><br />\r\n&nbsp;\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/htlslnh-1538556617.JPG\" style=\"max-width: 100%;\" /></p>\r\n<u><strong>CHƯƠNG TR&Igrave;NH HỖ TRỢ L&Atilde;I SUẤT LI&Ecirc;N NG&Acirc;N H&Agrave;NG</strong></u></div>\r\n\r\n<div style=\"text-align: center;\">Chi tiết c&aacute;c đợt thanh to&aacute;n như sau:\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/htlslnh2-1538556768.JPG\" style=\"max-width: 100%;\" /></p>\r\n<u><strong>DANH S&Aacute;CH C&Aacute;C NG&Acirc;N H&Agrave;NG LI&Ecirc;N KẾT</strong></u>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/nhlkjpg-1538556873.JPG\" style=\"max-width: 100%;\" /><br />\r\n<strong>Gi&aacute; B&aacute;n Dự Kiến (Giai đoạn 1)</strong><br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Safira%20Khang%20%C4%90i%E1%BB%81n/Thanh%20toan%20-%20Chiet%20Khau/gia-1538558754.JPG\" style=\"max-width: 100%;\" /></p>\r\n</div>\r\n',NULL,0,1,0,6,'2018-09-26 14:38:12','2018-10-04 14:43:11',1,1),(8,'Beach Village Aloha Bình Thuận','beach-village-aloha-binh-thuan','beach village aloha binh thuan','Dự &aacute;n khu phức hợp Trung T&acirc;m Thương Mại, Shop House, Khu nghỉ dưỡng, biệt thự Aloha sắp được triển khai tại trung t&acirc;m H&agrave;m Thuận Nam, tỉnh B&igrave;nh Thuận, nơi được mệnh danh l&agrave; &quot;Mũi N&eacute; 2&quot;. Ch&uacute;ng t&ocirc;i mang đến một kh&ocirc;ng gian sống chuẩn Resort với những tiện &iacute;ch 5 sao v&agrave; ba mặt hướng biển sẽ l&agrave;m h&agrave;i l&ograve;ng những vị kh&aacute;ch kh&oacute; t&iacute;nh khi đặt ch&acirc;n đến đ&acirc;y. Tất cả c&aacute;c tiện &iacute;ch ngoại vi, địa danh thắng cảnh v&agrave; quy hoạch hạ tầng du lịch của tỉnh B&igrave;nh Thuận sẽ biến nơi đ&acirc;y trở th&agrave;nh thi&ecirc;n đường nghỉ dưỡng trong tương lai.<br />\r\n<br />\r\nTH&Ocirc;NG TIN TỔNG QUAN DỰ &Aacute;N:<br />\r\n<br />\r\n- Chủ đầu tư: C&ocirc;ng ty Cổ Phần Đầu Tư - Thương Mại - Dịch Vụ Việt &Uacute;c<br />\r\n- Địa chỉ: Giao lộ DT719 v&agrave; đường Thuận Qu&yacute;, x&atilde; Thuận Qu&yacute;, Huyện H&agrave;m Thuận Nam, tỉnh B&igrave;nh Thuận.<br />\r\n- Diện t&iacute;ch to&agrave;n khu: 15 ha<br />\r\n- Mật độ x&acirc;y dựng: 23%<br />\r\n- Tầng cao: Khối Ruby 4 tầng<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Khối Sapphire: 1 tầng hầm - 1 tầng thượng - 12 tầng nổi.<br />\r\n- Thời gian ho&agrave;n thiện: Giai đoạn 1: Khu vực Beach Camping v&agrave; khối Ruby - 2018<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Giai đoạn 2: Khối Sapphire - Khu tiện t&iacute;ch tổng hợp - 2020<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Giai đoạn 3: Dự kiến 2021<br />\r\n- Parking: Đ&aacute;p ứng đủ nhu cầu đỗ xe m&aacute;y, xe hơi v&agrave; xe du lịch của du kh&aacute;ch.<br />\r\n- Sở hữu: L&acirc;u d&agrave;i đối với người Việt Nam, 50 năm đối với người Nước ngo&agrave;i.\r\n<p>&nbsp;</p>\r\n','Dự án khu phức hợp Trung Tâm Thương Mại, Shop House, Khu nghỉ dưỡng, biệt thự Aloha sắp được triển khai tại trung tâm Hàm Thuận Nam, tỉnh Bình Thuận. Chúng tôi mang đến một không gian sống chuẩn Resort với những tiện ích 5 sao và ba mặt hướng biển sẽ làm hài lòng những vị khách khó tính khi đặt chân đến đây.\r\n','0938.399.647 (Ms. Thu Hương)',NULL,50,'<p class=\"text-center\"><img src=\"/public/uploads/images/Aloha%20Binh%20Thuan/phoi-canh-1-1539055589.jpg\" style=\"max-width: 100%;\" /></p>\r\n<strong><span style=\"font-size:16px;\">Địa chỉ dự &aacute;n</span></strong><br />\r\nGiao lộ ĐT719 v&agrave; đường Thuận Qu&yacute;, x&atilde; Thuận Qu&yacute;, huyện H&agrave;m Thuận Nam, tỉnh B&igrave;nh Thuận.<br />\r\n<br />\r\n<span style=\"font-size:16px;\"><strong>Vị tr&iacute;</strong></span><br />\r\nNằm tr&ecirc;n trục đường ĐT719, tuyến đường ven biển huyết mạch, giữ vai tr&ograve; chiến lược trong quy hoạch hạ tầng biển của Việt Nam.<br />\r\n<br />\r\nTọa lạc tại vị tr&iacute; cực l&yacute; tưởng - tiếp gi&aacute;p hai mặt tiền đường, &quot;lưng tọa sơn mặt hướng thủy&quot; v&agrave; được bao quanh bởi d&ograve;ng &quot;Long Mạch&quot; di chuyển từ n&uacute;i chạy dọc theo dự &aacute;n để rồi đổ biển lớn. Vị thế độc t&ocirc;n khiến cho ng&ocirc;i nh&agrave; được &ocirc;m ấp bởi &aacute;nh s&aacute;ng tự nhi&ecirc;n nhưng cũng tr&agrave;n ngập gi&oacute; biển. Aloha Beach Village được c&aacute;c chuy&ecirc;n gia phong thủy đ&aacute;nh gi&aacute; l&agrave; thế đất hội tụ linh kh&iacute; mang <strong>&quot;ngũ ph&uacute;c l&acirc;m m&ocirc;n&quot;</strong>.<br />\r\n<br />\r\n<span style=\"font-size:16px;\"><strong>Quy hoạch giao th&ocirc;ng trọng điểm</strong></span><br />\r\nCao tốc Dầu Gi&acirc;y - Phan Thiết<br />\r\nMở rộng cung đường ven biển ĐT719<br />\r\nMở đường ĐT719B<br />\r\nX&acirc;y dựng s&acirc;n bay quốc tế Phan Thiết<br />\r\nMở rộng cung đường Thuận Qu&yacute; - kết nối QL1A v&agrave; đường ven biển ĐT719<br />\r\n<br />\r\n&nbsp;','<p class=\"text-center\"><img src=\"/public/uploads/images/Aloha%20Binh%20Thuan/lien-ket-vung-1538407725.JPG\" style=\"max-width: 100%;\" /><br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aloha%20Binh%20Thuan/vi-tri-1-1538407726.JPG\" style=\"max-width: 100%;\" /></p>\r\n	\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aloha%20Binh%20Thuan/vi-tri-2-1538407726.JPG\" style=\"max-width: 100%;\" /></p>\r\n	\r\n','','',NULL,0,1,0,8,'2018-10-01 22:30:36','2018-10-09 10:32:49',1,1),(10,'Vinhomes Grand Park Quận 9','vinhomes-grand-park-quan-9','vinhomes grand park quan 9','Vinhomes l&agrave; th&agrave;nh phố văn minh, hiện đại được quy hoạch m&ocirc; h&igrave;nh đại đ&ocirc; thị đẳng cấp Singapore v&agrave; hơn thế nữa. Kh&ocirc;ng chỉ sở hữu những tiện &iacute;ch dịch vụ mang lại cuộc sống l&yacute; tưởng cho người d&acirc;n như ở Singapore, Vinhome Grand Park c&ograve;n lần đầu kiến tạo những tiện &iacute;ch độc đ&aacute;o như c&ocirc;ng vi&ecirc;n thể thao ngo&agrave;i trời với h&agrave;ng trăm m&aacute;y tập c&ugrave;ng c&ocirc;ng vi&ecirc;n BBQ với h&agrave;ng trăm điểm nướng. Đi k&egrave;m giải ph&aacute;p t&agrave;i ch&iacute;nh linh hoạt, Vinhomes Grand Park hứa hẹn l&agrave; giải ph&aacute;p đột ph&aacute; về nh&agrave; ở với người d&acirc;n Việt Nam, đồng thời mở ra cơ hội đầu tư hiệu quả nhờ vị tr&iacute; gi&agrave;u tiềm năng v&agrave; sức tăng trưởng gi&aacute; trong tương lai.\r\n<ul>\r\n	<li>T&ecirc;n dự &aacute;n: Vinhomes Grand Park Quận 9</li>\r\n	<li>Chủ đầu tư: Tập đo&agrave;n Vingroup</li>\r\n	<li>Đơn vị thi c&ocirc;ng : Nh&agrave; thầu Contecons v&agrave; H&ograve;a B&igrave;nh</li>\r\n	<li>Vị tr&iacute; dự &aacute;n: Đường Nguyễn Xiển giao với Phước Thiện, Phường Long B&igrave;nh, Quận 9, TP. Hồ Ch&iacute; Minh</li>\r\n	<li>&nbsp;Quy m&ocirc;: l&agrave; c&aacute;c t&ograve;a căn hộ gi&aacute; rẻ &nbsp;cao từ 22 &ndash; 25 tầng; c&oacute; rất nhiều diện t&iacute;ch đa dạng từ 40 m2 đến 90 m2.</li>\r\n	<li>Tổng diện t&iacute;ch: Hơn 365 ha</li>\r\n	<li>Khởi c&ocirc;ng: Qu&yacute; I/2017.</li>\r\n	<li>Mật độ x&acirc;y dựng: khoảng 20 &ndash; 25%</li>\r\n	<li>Diện t&iacute;ch c&ocirc;ng vi&ecirc;n xanh: &nbsp;36 ha</li>\r\n	<li>Loại h&igrave;nh ph&aacute;t triển: Căn hộ , nh&agrave; phố liền kề, biệt thự, nh&agrave; thương mại dịch vụ ( shophouse)</li>\r\n	<li>Số lượng t&ograve;a th&aacute;p: Gồm 71 th&aacute;p&nbsp;</li>\r\n	<li>Số lượng căn hộ: 50,000 căn hộ\r\n	<ul>\r\n		<li>Diện t&iacute;ch 1 Ph&ograve;ng ngủ từ 40m2 đến 45m2</li>\r\n		<li>Diện t&iacute;ch 2 Ph&ograve;ng ngủ từ 58m2 đến 68m2</li>\r\n		<li>Diện t&iacute;ch 3 Ph&ograve;ng ngủ diện t&iacute;ch từ 80m2 đến 90m2</li>\r\n		<li>Ti&ecirc;u chuẩn b&agrave;n giao: Th&ocirc; trống &ndash; B&aacute;n ho&agrave;n thiện &amp; Ho&agrave;n thiện nội thất.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Số lượng nh&agrave; phố liền kề, nh&agrave; phố thương mại, biệt thự&nbsp;</li>\r\n	<li>Diện T&iacute;ch Nh&agrave; Phố: 100m2 &ndash; 180 m2.</li>\r\n	<li>Diện T&iacute;ch Shophouse: 100m2 &ndash; 180 m2.</li>\r\n	<li>Diện T&iacute;ch Biệt Thự : 200m2 &ndash; 400 m2.</li>\r\n	<li>Trường học Vinschool, Bệnh biện Vinmec, Si&ecirc;u thị, Nh&agrave; h&agrave;ng,&hellip;</li>\r\n	<li>H&igrave;nh thức sở hữu: Vĩnh viễn.</li>\r\n</ul>\r\n<br />\r\n<span style=\"color:#3498db;\"><span style=\"font-size:18px;\"><strong>0938.399.647 (Ms. Thu Hương)</strong></span></span>','ĐẠI ĐÔ THỊ ĐẲNG CẤP SINGAPORE VÀ HƠN THẾ NỮA.','0938.399.647 (Ms. Thu Hương)',NULL,63,'<p class=\"text-center\"><img src=\"/public/uploads/images/Vincity%20Q9/vi-tri-vincity-1553141601.jpg\" style=\"max-width: 100%;\" /><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"text-left\">Vinhomes Quận 9 được tọa lạc mặt tiền đường Nguyễn Xiển khu vực ngay vị tr&iacute; trung t&acirc;m của Quận 9</li>\r\n	<li class=\"text-left\">Tiếp gi&aacute;p với Khu c&ocirc;ng nghệ cao 1,2.</li>\r\n	<li class=\"text-left\">Kết nối cao tốc S&agrave;i G&ograve;n &ndash; Long Th&agrave;nh Dầu Gi&acirc;y.</li>\r\n	<li class=\"text-left\">Năm 2018 khởi c&ocirc;ng x&acirc;y dựng bến xe miền đ&ocirc;ng mới.</li>\r\n	<li class=\"text-left\">Tuyến đường V&agrave;nh Đai 2 kết nối với cầu Ph&uacute; Mỹ với đại lộ Nguyễn Văn Linh</li>\r\n	<li class=\"text-left\">Trục đường xa lộ H&agrave; Nội đ&atilde; được mở rộng.</li>\r\n	<li class=\"text-left\">Khu vui chơi &ndash; giải tr&iacute; du lịch Khoang Xanh Suối Ti&ecirc;n chỉ trong 10 ph&uacute;t.</li>\r\n	<li class=\"text-left\">Tuyến đường cao tốc (Metro)&nbsp;từ khu vực Suối Ti&ecirc;n tới trung t&acirc;m Th&agrave;nh phố.</li>\r\n	<li class=\"text-left\">Đi đến c&aacute;c S&acirc;n Golf như Rạch Chiếc, Thủ Đức v&agrave; Long Th&agrave;nh rất thuận tiện.</li>\r\n</ul>\r\n','Chung Cư Vinhomes Grand Park Quận 9 : Với thiết kế mang hơi thở của kiến tr&uacute;c ch&acirc;u &acirc;u v&agrave; với chiến lược x&acirc;y dựng khu đ&ocirc; thị mang hơi thở xanh n&ecirc;n chắc chắn qu&yacute; kh&aacute;ch h&agrave;ng sống trong căn hộ Vinhomes Grand Park quận 9 hồ ch&iacute; minh sẽ được đắm ch&igrave;m trong sắc xanh thi&ecirc;n nhi&ecirc;n, nơi b&igrave;nh y&ecirc;n an lạc, nơi sống đẳng cấp tiện nghi v&agrave; nơi vui cuộc đời hạnh ph&uacute;c<br />\r\n<br />\r\n<strong>1.Tiện &Iacute;ch Nội đ&ocirc; thị Vinhomes Quận 9</strong>\r\n<ul>\r\n	<li>Gồm Nhiều tiện &iacute;ch cao cấp đồng bộ v&agrave; đẳng cấp như:</li>\r\n	<li>Cổng ch&agrave;o đẹp mắt v&agrave; sang trọng,</li>\r\n	<li>&nbsp;Đ&agrave;i phun nước,</li>\r\n	<li>&nbsp;Vườn Hoa đi dạo, Ph&ograve;ng Gym, Yoga, Spa, tennis, s&acirc;n golf &nbsp;&hellip;,</li>\r\n	<li>Kh&aacute;ch sạn, resort cao cấp 5 sao</li>\r\n	<li>Khu vui chơi giải tr&iacute;, tổ chức sự kiện</li>\r\n	<li>Bể bơi ngo&agrave;i trời diện t&iacute;ch lớn</li>\r\n	<li>Vincom: Trung t&acirc;m thương mại của VinGroup.</li>\r\n	<li>Vinmec: Bệnh viện chuẩn Quốc tế của VinGroup.</li>\r\n	<li>VinSchool: Trường học chuẩn Quốc tế của VinGroup.</li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Vincity%20Q9/tien-ich-chung-cu-vinhomes-cao-xa-la-1539059221.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p><strong>2. Tiện &Iacute;ch Phong Thủy Vinhomes&nbsp;Quận 9 Hồ Ch&iacute; Minh</strong></p>\r\n\r\n<ul>\r\n	<li>Căn hộ Vinhomes Grand Park quận 9: sở hữu một vị tr&iacute; đẹp, đắc địa về phong thủy ch&iacute;nh l&agrave; một điểm thu h&uacute;t của dự &aacute;n. Sống tại đ&acirc;y qu&yacute;&nbsp;kh&aacute;ch sẽ được h&ograve;a m&igrave;nh v&agrave;o kh&ocirc;ng gian tự nhi&ecirc;n, với biển trời bao la, kh&ocirc;ng gian thiết kế xanh độc đ&aacute;o. Một khoảng trời &nbsp;xanh nhỏ tại chung cư vinhomes quận 9 th&ocirc;i nhưng cũng đủ&nbsp;để tạo n&ecirc;n một kh&ocirc;ng gian thư gi&atilde;n, tinh tế. N&uacute;i non, th&aacute;c nước, c&acirc;y cối&hellip;.. l&agrave; những biểu tượng của vũ trụ thu nhỏ theo quan niệm phương Đ&ocirc;ng&nbsp;chứ kh&ocirc;ng chỉ đơn thuần l&agrave; trang tr&iacute;.</li>\r\n	<li>Điều quan trọng trong thế ph&uacute; qu&yacute; của dự &aacute;n vinhomes quận 9 &nbsp;đ&oacute; ch&iacute;nh l&agrave; thế tự nhi&ecirc;n do trời đất ban tặng, n&ecirc;n đ&acirc;y được xem l&agrave; mảnh đất thi&ecirc;n thời địa lợi&nbsp;sẽ mang may mắn, t&agrave;i lộc v&agrave; thịnh vượng cho gia chủ suốt đời.</li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Vincity%20Q9/tien-ich-1539060004.jpg\" style=\"max-width: 100%;\" /><br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Vincity%20Q9/mat-bang-vincity-1553141609.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n','<strong><span style=\"font-size:16px;\">1. Căn hộ Vinhomes Grand Park Quận 9</span></strong>\r\n<ul>\r\n	<li>Căn hộ 1 Ph&ograve;ng Ngủ: diện t&iacute;ch từ 40m2 &ndash; 45m2</li>\r\n	<li>Căn hộ 2 Ph&ograve;ng Ngủ: diện t&iacute;ch từ 58m2 đến 68m2&nbsp;</li>\r\n	<li>Căn hộ 3 Ph&ograve;ng Ngủ: diện t&iacute;ch từ 80m2 đến 90m2&nbsp;&nbsp;</li>\r\n</ul>\r\n<strong><span style=\"font-size:16px;\">2. Nh&agrave; phố Vinhomes quận 9&nbsp;</span></strong><br />\r\nNh&agrave; phố vinhomes grand park c&oacute; diện t&iacute;ch từ 100m2 ; 120m2; 135m2; 150m2; 180m2&nbsp;<br />\r\n<strong><span style=\"font-size:16px;\">3. Shophouse vinhomes river park quận 9&nbsp;</span></strong><br />\r\nShophouse vinhomes river park c&oacute; diện t&iacute;ch: 100m2; 120m2; 145m2; 165m2; 180m2&nbsp;<br />\r\n<span style=\"font-size:16px;\"><strong>4. Biệt thự vinhomes river park&nbsp;</strong></span><br />\r\nBiệt thự vinhomes river park c&oacute; diện t&iacute;ch: 200m2; 250m2; 300m2; 400m2 c<br />\r\n<br />\r\n<br />\r\n<em>Gi&aacute; Chi Tiết Từng Căn Hộ V&agrave; Ch&iacute;nh S&aacute;ch Mua B&aacute;n vui l&ograve;ng li&ecirc;n Hệ <span style=\"color:#e74c3c;\">0938.399.647</span> (Ms. Thu Hương)</em>','',NULL,0,1,0,9,'2018-10-09 10:55:42','2019-04-09 08:56:44',1,1),(11,'Dự án căn hộ Sunshine City Saigon','du-an-can-ho-sunshine-city-saigon','du an can ho sunshine city saigon','Lấy cảm hứng từ d&ograve;ng s&ocirc;ng Hudson của New York phồn hoa, Sunshine City được x&acirc;y dựng b&ecirc;n d&ograve;ng s&ocirc;ng Cả Cấm tại bờ Nam th&agrave;nh phố, nơi hưởng trọn sinh kh&iacute; thịnh vượng từ d&ograve;ng chảy t&agrave;i lộc xanh m&aacute;t v&agrave; trong l&agrave;nh, n&acirc;ng tầm cuộc sống cho mỗi cư d&acirc;n nơi đ&acirc;y th&agrave;nh một nghệ thuật v&ocirc; c&ugrave;ng đẳng cấp.<br />\r\n<br />\r\n<strong>TH&Ocirc;NG TIN DỰ ÁN SUNSHINE CITY SÀI GÒN</strong><br />\r\n+ T&ecirc;n dự &aacute;n: Sunshine City S&agrave;i G&ograve;n<br />\r\n+ Chủ đầu tư dự &aacute;n: Tập đo&agrave;n Sunshine Group<br />\r\n+ Vị tr&iacute; dự &aacute;n: mặt tiền ng&atilde; tư đường Huỳnh Tấn Ph&aacute;t giao với đường Ph&uacute; Thuận, Phường T&acirc;n Ph&uacute;, liền kề khu đ&ocirc; thị sầm uất Ph&uacute; Mỹ Hưng, Quận 7, Tp.HCM<br />\r\n+ Tổng thầu x&acirc;y dựng: Ho&agrave; B&igrave;nh<br />\r\n+ Chịu tr&aacute;ch nhiệm gi&aacute;m s&aacute;t: Apave<br />\r\n+ Đơn vị quản l&yacute;: CBRE<br />\r\n+ Quy m&ocirc;: tổng diện t&iacute;ch dự &aacute;n 42.529m2<br />\r\n+ C&oacute;: 9 block cao từ 26 &ndash; 38 tầng, c&oacute; 2 tầng hầm, bao gồm 3748 căn<br />\r\n+ Loại h&igrave;nh sản phẩm: căn hộ cao cấp, Shophouse, Officetel, Duplex<br />\r\n+ Số ph&ograve;ng ngủ: Từ 2 &ndash; 3 &ndash; 4 Ph&ograve;ng Ngủ tiện nghi diện t&iacute;ch&nbsp;<strong>67m2 &ndash; 130m2</strong> v&agrave; penhouse tr&ecirc;n &aacute;p m&aacute;i (c&oacute; hồ bơi)<br />\r\n+ B&agrave;n giao: ho&agrave;n thiện<br />\r\n+ Tiện &iacute;ch: c&ocirc;ng nghệ 4.0 hiện đại c&ugrave;ng hệ thống chiếu s&aacute;ng rực rỡ bao quanh dự &aacute;n v&agrave; hơn 60 tiện &iacute;ch đẳng cấp 5 sao phục vụ cư d&acirc;n.&nbsp;Sky Bar Panorama, Sky Walk, s&ocirc;ng nội khu, l&otilde;i cảnh quan phong c&aacute;ch vườn ch&acirc;u &Acirc;u, trường học quốc tế&hellip;<br />\r\n+ Thời gian thi c&ocirc;ng dự &aacute;n: qu&yacute; IV/2018<br />\r\n+ Thời gian b&agrave;n giao dự &aacute;n: dự kiến qu&yacute; IV/2020<br />\r\n+ Loại h&igrave;nh sở hữu: sổ hồng. 50 năm đối với cư d&acirc;n nước ngo&agrave;i v&agrave; sổ hồng vĩnh viễn đối với cư d&acirc;n Việt Nam.','DỰ ÁN “SIÊU” SANG TẠI SÀI GÒN – LIỀN KỀ PHÚ MỸ HƯNG, GIÁ CHỈ TỪ 50 – 55 TRIỆU/M2, CHỦ ĐẦU TƯ SUNSHINE GROUP CỰC KỲ UY TÍN\r\n\r\n','0938.399.647 (Ms. Thu Hương)',NULL,69,'<p style=\"text-align: center;\"><strong>VỊ TR&Iacute; DỰ &Aacute;N</strong></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/map_img-1543894932.jpg\" style=\"max-width: 100%;\" /></p>\r\nDự &aacute;n Sunshine City Saigon nằm ngay vị tr&iacute; V&Agrave;NG khu vực Quận 7, nh&igrave;n ra d&ograve;ng s&ocirc;ng Cả Cấm hiền h&ograve;a, thuận tiện kết nối v&agrave;o trung t&acirc;m th&ocirc;ng qua hệ thống cầu đường hiện đại như: Nguyễn Lương Bằng, Nguyễn Văn Linh, Huỳnh Tấn Ph&aacute;t, Nguyễn Hữu Thọ,&hellip; dễ d&agrave;ng di chuyển v&agrave;o c&aacute;c quận trung t&acirc;m, huyện B&igrave;nh Ch&aacute;nh hoặc Nh&agrave; B&egrave;.\r\n\r\n<ul>\r\n	<li>Ph&iacute;a Đ&ocirc;ng view hướng cầu Ph&uacute; Mỹ, Đại lộ Nguyễn Văn Linh, khu d&acirc;n cư hiện hữu.</li>\r\n	<li>Ph&iacute;a T&acirc;y view hướng đường Huỳnh Tấn Ph&aacute;t, cầu Ph&uacute; Mỹ.</li>\r\n	<li>Ph&iacute;a Nam view hướng PMH Qu&acirc;̣n 7, trường Quốc tế, đường Nguyễn Lương Bằng.</li>\r\n	<li>Ph&iacute;a Bắc gi&aacute;p PMH, view to&agrave;n khu đ&ocirc; thị mới PMH Qu&acirc;̣n 7, Trung t&acirc;m triển l&atilde;m SECC, Trung t&acirc;m thương mại Paragon, Crescent Mall, Vivo City&hellip;</li>\r\n</ul>\r\n\r\n<p>Đặc biệt, Sunshine City Saigon nằm ngay khu Trung t&acirc;m Thương mại &ndash; T&agrave;i ch&iacute;nh quốc tế PMH Qu&acirc;̣n 7, c&aacute;c cao ốc văn ph&ograve;ng hiện đại, cư d&acirc;n sẽ được tận hưởng tất cả tiện &iacute;ch như khu mua sắm hiện đại, trung t&acirc;m triển l&atilde;m, nh&agrave; h&agrave;ng, trường đại học, bệnh viện, s&acirc;n golf,...</p>\r\n\r\n<p style=\"text-align: center;\">--------------------------------------------------------oOo--------------------------------------------------------</p>\r\n','<div style=\"text-align: center;\"><strong>TIỆN &Iacute;CH NỘI KHU</strong></div>\r\n<br />\r\nCăn hộ Sunshine City S&agrave;i G&ograve;n l&agrave; nơi hội tụ đầy đủ hệ thống tiện &iacute;ch đẳng cấp. Tại đ&acirc;y cư d&acirc;n sẽ được trải nghiệm 1 cuộc sống đầy đủ nhất, hiện đại nhất &amp; cao cấp nhất đặc trưng ri&ecirc;ng cho giới thượng lưu. Khi bước ch&acirc;n v&agrave;o căn hộ Sunshine City S&agrave;i G&ograve;n cư d&acirc;n sẽ cảm nhận được 1 kh&ocirc;ng gian sống cực kỳ hiện đại. Đồng thời mọi đồ d&ugrave;ng vật tư &amp; nội thất tại căn hộ đều l&agrave; h&agrave;ng chất lượng v&agrave; cao cấp. Đ&acirc;y sẽ l&agrave; nơi trải nghiệm cuộc sống tốt nhất d&agrave;nh cho cư d&acirc;n.\r\n<ul>\r\n	<li>S&acirc;n chơi trẻ em - Trường mầm non</li>\r\n	<li>Bể bơi v&ocirc; cực - Th&aacute;c tr&agrave;n nghệ thuật</li>\r\n	<li>Cafe &amp; Bar ngo&agrave;i trời - Rooftop City Bar</li>\r\n	<li>Ph&ograve;ng gym, spa hiện đại, n&acirc;ng cao sức khoẻ - S&acirc;n tennis - Đường chạy bộ</li>\r\n	<li>Cầu đi bộ li&ecirc;n t&ograve;a - Dịch vụ bảo vệ 24/24 - Cổng ch&agrave;o</li>\r\n	<li>Nh&agrave; h&agrave;ng - Khu mua sắm</li>\r\n</ul>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/tien-ich-1543894355.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<div style=\"text-align: center;\">--------------------------------------------------------oOo--------------------------------------------------------</div>\r\n','<p class=\"text-center\" style=\"text-align: center;\"><strong>MẶT BẰNG TỔNG THỂ</strong><br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/mat-bang-tong-the-1543892595.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\" style=\"text-align: center;\">--------------------------------------------------------oOo--------------------------------------------------------<br />\r\n<b>MẶT BẰNG CĂN HỘ</b></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/gallary_img_1-1543892276.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/gallary_img_2-1543892276.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/gallary_img_3-1543892276.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Sunshine%20Q7/gallary_img_4-1543892276.jpg\" style=\"max-width: 100%;\" /></p>\r\n','<div>Hiện chủ đầu tư Sunshine Group S&agrave;i G&ograve;n ch&iacute;nh thức c&ocirc;ng bố mức gi&aacute; b&aacute;n căn hộ chung cư Sunshine City S&agrave;i G&ograve;n từ &nbsp;<strong>50-55 tr/m2 (chưa VAT)</strong></div>\r\n\r\n<div><br />\r\nĐặc biệt ưu đ&atilde;i cao trong ĐỢT 1 diễn ra trong th&aacute;ng 11 &ndash; 12/2018.<br />\r\n<br />\r\nCh&iacute;nh s&aacute;ch d&agrave;nh cho kh&aacute;ch h&agrave;ng như sau:<br />\r\n<br />\r\nKh&aacute;ch thanh to&aacute;n 30% k&iacute; HĐMB, CĐT hỗ trợ l&atilde;i cho 65% gi&aacute; trị căn hộ bao gồm VAT trong 18 th&aacute;ng<br />\r\nNếu kh&aacute;ch muốn tt ngay 50% khi k&iacute; HĐMB : ck 4%<br />\r\nNếu kh&aacute;ch muốn tt ngay 70% khi k&iacute; HĐMB : ck 6%<br />\r\nNếu kh&aacute;ch muốn tt ngay 95% khi k&iacute; HĐMB : ck 10%<br />\r\nNếu kh&aacute;ch kh&ocirc;ng d&ugrave;ng chương tr&igrave;nh hỗ trợ vay từ CĐT : ck 3%<br />\r\nTheo th&ocirc;ng b&aacute;o của chủ đầu tư Sunshine Group, từ ng&agrave;y 20/11/2018 kh&aacute;ch h&agrave;ng quan t&acirc;m v&agrave; mong muốn sở hữu căn hộ Sunshine City S&agrave;i G&ograve;n đ&atilde; c&oacute; thể ĐĂNG K&Yacute; ƯU TI&Ecirc;N để tham gia mua căn hộ ngay trong ĐỢT MỞ B&Aacute;N ĐẦU TI&Ecirc;N với nhiều ch&iacute;nh s&aacute;ch v&agrave; ưu đ&atilde;i hấp dẫn.</div>\r\n',NULL,0,1,0,11,'2018-11-30 09:55:51','2018-12-05 21:25:25',1,1),(12,'Căn hộ Hausbelo Quận 9 \"Đơn giản là nhà\"','can-ho-hausbelo-quan-9-don-gian-la-nha','can ho hausbelo quan 9 don gian la nha','<h2><strong><span style=\"font-size:14px;\">Dự &aacute;n Căn hộ cảm hứng Ch&acirc;u &Acirc;u, phương thức thanh to&aacute;n tối ưu 1% /th&aacute;ng đến khi nhận nh&agrave;.</span></strong></h2>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px;\">Chủ đầu tư dự &aacute;n: Tập Đo&agrave;n EZ Land đến từ Ch&acirc;u &Acirc;u</span></li>\r\n	<li><span style=\"font-size:14px;\">Đơn vị thi c&ocirc;ng: top 5 đơn vị h&agrave;ng đầu của Việt Nam</span></li>\r\n	<li><span style=\"font-size:14px;\">Vị tr&iacute; dự &aacute;n: phường Ph&uacute; Hữu, quận 9, th&agrave;nh phố Hồ Ch&iacute; Minh.</span></li>\r\n	<li><span style=\"font-size:14px;\">Ph&aacute;p l&yacute;: sổ hồng l&acirc;u d&agrave;i đối với người Việt Nam, 50 năm đối với người nước ngo&agrave;i.</span></li>\r\n	<li><span style=\"font-size:14px;\">Tổng diện t&iacute;ch: 13.333 m<sup>2</sup>.</span></li>\r\n	<li><span style=\"font-size:14px;\">Tổng số căn hộ: 888 căn.</span></li>\r\n	<li><span style=\"font-size:14px;\">Tổng số block: 3 block cao 15 tầng.</span></li>\r\n	<li><span style=\"font-size:14px;\">Diện t&iacute;ch xanh: chiếm 50% diện t&iacute;ch dự &aacute;n.</span></li>\r\n	<li><span style=\"font-size:14px;\">B&agrave;n giao: Qu&yacute; I/2021.</span></li>\r\n	<li><span style=\"font-size:14px;\">Tỷ lệ số lượng căn hộ:&nbsp; Căn hộ 1 PN: 18%, Căn hộ 1+1 PN: 16%, Căn hộ 2 PN: 61%, Căn hộ 3 PN: 3 %,&nbsp; Căn hộ thương mại: c&ograve;n lại.</span></li>\r\n</ul>\r\n<strong>5 ĐIỂM NỔI BẬT CỦA DỰ &Aacute;N HAUSBELO Q9</strong>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:14px;\">100% vốn từ ch&acirc;u &Acirc;u( Đức) -&gt; Tiềm lực t&agrave;i ch&iacute;nh mạnh</span></li>\r\n	<li><span style=\"font-size:14px;\">Thanh to&aacute;n chỉ 1%/th&aacute;ng, tối đa 50% gi&aacute; trị căn hộ đến thời điểm nhận nh&agrave;.</span></li>\r\n	<li><span style=\"font-size:14px;\">CĐT hiếm hoi c&oacute; được uy t&iacute;n cực tốt ở ph&acirc;n kh&uacute;c Trung cấp (Hausneo vượt tiến độ, chất lượng x&acirc;y dựng tốt v&agrave; vật liệu b&agrave;n giao tốt hơn HĐMB).</span></li>\r\n	<li><span style=\"font-size:14px;\">Gi&aacute; tốt hơn nhiều dự &aacute;n c&ugrave;ng ph&acirc;n kh&uacute;c trong khu vực.</span></li>\r\n	<li><span style=\"font-size:14px;\">Thị trường thứ cấp của Haus lu&ocirc;n s&ocirc;i động &amp; tốt hơn c&aacute;c dự &aacute;n c&ugrave;ng ph&acirc;n kh&uacute;c</span></li>\r\n</ol>\r\n<span style=\"font-size:14px;\">Qu&yacute; kh&aacute;ch h&agrave;ng quan t&acirc;m đến căn hộ Hausbelo c&oacute; thể đăng k&yacute; hỗ trợ tư vấn.</span>','Với \"hơi thở\" Châu Âu len lỏi trong văn hóa Á Đông đầy màu sắc. Hausbelo chính là không gian bình yên, đơn giản gọi là \"Nhà\".\r\nMột nơi để bạn trở về, nghỉ ngơi sau những lo toan bộn bề của cuộc sống. Nơi để bạn tận hưởng trọn vẹn từng giây phút ngọt ngào bên những người thân yêu.\r\nTừ thiết kế thông minh, tiện tích tiêu chuẩn đến tiến độ bàn giao và quy trình thanh toán, tất cả đều được Hausbelo thông tin minh bạch, mang lại sự an tâm trong từng khoảnh khắc sống.\r\n','0938.399.647 (Ms. Thu Hương)',NULL,72,'<p class=\"text-center\">Sở hữu vị tr&iacute; trọng điểm trong l&ograve;ng khu Đ&ocirc;ng S&agrave;i G&ograve;n,&nbsp;<strong>dự &aacute;n căn hộ HausBelo</strong>&nbsp;toạ lạc tại kế cận đường Li&ecirc;n Phường v&agrave; đại lộ V&otilde; Ch&iacute; C&ocirc;ng. Từ dự &aacute;n, cộng đồng d&acirc;n cư c&oacute; thể kết nối ho&agrave;n hảo với to&agrave;n bộ những khu vực trọng điểm khu Đ&ocirc;ng như trung t&acirc;m thương mại (Parkson, Vincom..) hay cơ quan h&agrave;nh ch&iacute;nh. Đặc biệt với những kh&aacute;ch h&agrave;ng tiềm năng của&nbsp;<strong>dự &aacute;n&nbsp;HausBelo</strong>&nbsp;thường xuy&ecirc;n di chuyển giữa S&agrave;i G&ograve;n v&agrave; Đồng Nai, B&igrave;nh Dương, HausBelo&nbsp;cung cấp khả năng kết nối nhanh ch&oacute;ng v&agrave; tiện lợi từ cao tốc Long Th&agrave;nh - Dầu Gi&acirc;y.<br />\r\n<br />\r\n<img src=\"/public/uploads/images/Hausbelo%20Q9/vi-tri-du-an-hausbelo-1545278227.jpg\" style=\"max-width: 100%;\" /><br />\r\nVới định hướng trọng t&acirc;m ph&aacute;t triển nền kinh tế chất x&aacute;m đến năm 2025, c&aacute;c căn hộ như&nbsp;<strong>dự &aacute;n&nbsp;HausBelo</strong>&nbsp;quận 9 c&oacute; một tiềm năng ph&aacute;t triển vượt bậc trong tương lai gần.C&aacute;c cơ sở hạ tầng giao th&ocirc;ng tại đ&acirc;y đang được ho&agrave;n thiện từng ng&agrave;y tạo điều kiện kết nối quận 9 với c&aacute;c v&ugrave;ng quan trọng kh&aacute;c như quận 1, quận 2, quận 7 v&agrave; s&acirc;n bay quốc tế Long Th&agrave;nh.</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/vi-tri-du-an-hausbelo-2-1545278226.png\" style=\"max-width: 100%;\" /></p>\r\n','<h2><strong>TIỆN &Iacute;CH DỰ &Aacute;N</strong></h2>\r\n\r\n<h3><strong><span style=\"font-size:14px;\">TIỆN &Iacute;CH NỘI KHU</span></strong></h3>\r\nB&atilde;i đậu xe ngo&agrave;i trời. S&acirc;n thể thao đa năng. Khu vực gym. S&acirc;n chơi trẻ em. S&acirc;n chơi nước trẻ em. C&ocirc;ng vi&ecirc;n cảnh quan (800m<sup>2</sup>). Đường chạy bộ. Khu vực BBQ. Hồ bơi người lớn, trẻ em. Ph&ograve;ng sinh hoạt cộng đồng. Cửa h&agrave;ng tiện &iacute;ch; S&acirc;n b&oacute;ng b&agrave;n. Khu vực cafe ngo&agrave;i trời.\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/tien-ich-hausbelo-1400x800-1545290509.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/tien-ich-hausbelo-3-1545290519.jpg\" style=\"max-width: 100%;\" /></p>\r\n<strong><span style=\"font-size:14px;\">TIỆN &Iacute;CH NGOẠI KHU</span></strong><br />\r\nNgo&agrave;i hệ thống tiện &iacute;ch nội khu đầy đủ, dự &aacute;n HausBelo c&ograve;n thừa hường được khối tiện &iacute;ch ngoại khu đa dạng nhờ hệ thống hạ tầng đ&atilde; v&agrave; đang được tiếp tục đầu tư tại khu vực như:<br />\r\n&bull; Trung t&acirc;m t&agrave;i ch&iacute;nh thương mại bậc nhất S&agrave;i G&ograve;n Sala<br />\r\n&bull; Khu đ&ocirc; thị Ph&uacute; Mỹ Hưng<br />\r\n&bull; Vincom L&ecirc; Văn Việt<br />\r\n&bull; Hệ thống c&aacute;c trường đại học trong khu vực quận 1, 2, 4, 7, 9 đặc biệt dự &aacute;n trường đại học Fulbright v&agrave; Nguyễn Tất Th&agrave;nh đang đ&acirc;u tư x&acirc;y dựng<br />\r\n&bull; Dự &aacute;n Aeon Mall đang được l&ecirc;n kế hoạch tại v&ograve;ng xoay Li&ecirc;n Phường v&agrave; V&otilde; Ch&iacute; C&ocirc;ng<br />\r\n&bull; Hệ thống c&aacute;c trường mầm non, tiểu học, trung học chất lượng đ&agrave;o tạo nước ngo&agrave;i quận 2<br />\r\n&bull; Khu trung t&acirc;m thương mại The Art đang được x&acirc;y dựng<br />\r\n&bull; B&ecirc;nh viện quốc tế Ph&uacute;c An Khang<br />\r\n&bull; Bến xe Miền Đ&ocirc;ng đang được dời về quận 9<br />\r\n&bull; Khu c&ocirc;ng nghệ cao giai đoạn 2.<br />\r\n<br />\r\n&nbsp;','<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/layout-mat-bang-04-14-hausbelo-191218-1545291194.jpg\" style=\"max-width: 100%;\" /></p>\r\n','<span style=\"font-size:16px;\"><strong>GI&Aacute; V&Agrave; PHƯƠNG THỨC THANH TO&Aacute;N</strong></span><br />\r\n<strong>1/ Gi&aacute; b&aacute;n Hausbelo đợt 1 sẽ từ 27 triệu/m2.</strong><br />\r\n<br />\r\nNếu so s&aacute;nh với c&aacute;c căn hộ chung cư gi&aacute; rẻ Quận 9 tại Ph&uacute; Hữu, Phước Long B như: Sky 9 hay Thủ Thi&ecirc;m Garden,&hellip; th&igrave; gi&aacute; b&aacute;n Hausbelo l&agrave; tương đương. Tuy nhi&ecirc;n, x&eacute;t kỹ c&aacute;c yếu tố như: uy t&iacute;n chủ đầu tư, nh&agrave; thầu thi c&ocirc;ng, tiện &iacute;ch sống, ho&agrave;n thiện theo ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u&hellip; th&igrave; gi&aacute; Hausbelo l&agrave; ho&agrave;n to&agrave;n rẻ.<br />\r\n<br />\r\nSo s&aacute;nh với gi&aacute; b&aacute;n căn hộ Quận 9 c&ugrave;ng ph&acirc;n kh&uacute;c như Flora Fuji, Jamila hay mới nhất l&agrave; Safira Khang Điền&hellip; th&igrave; gi&aacute; b&aacute;n Hausbelo dự kiến thấp hơn, vừa tầm với hơn với qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thu nhập trung b&igrave;nh.<br />\r\n<br />\r\nĐặc biệt, với Hausbelo, qu&yacute; kh&aacute;ch h&agrave;ng thể mua căn hộ Quận 9 trả g&oacute;p với 1%/th&aacute;ng.<br />\r\n<br />\r\n<strong>2/ Phương thức thanh to&aacute;n Hausbelo chỉ 1%/th&aacute;ng</strong><br />\r\nDự kiến, phương thức thanh to&aacute;n Hausbelo Ez Land l&agrave; cực kỳ linh hoạt, chỉ 1%/th&aacute;ng, mang đến &ldquo;cơ hội r&otilde; r&agrave;ng&rdquo; hơn bao giờ hết, cho c&aacute;c gia đ&igrave;nh c&oacute; mức thu nhập trung b&igrave;nh c&oacute; thể sở hữu căn hộ ti&ecirc;u chuẩn Ch&acirc;u &Acirc;u.<br />\r\n<br />\r\nVới tiến độ thanh to&aacute;n 1%, qu&yacute; kh&aacute;ch h&agrave;ng sẽ cần c&oacute; trước 30% gi&aacute; trị hợp đồng (10% khi k&yacute; cọc v&agrave; 20% khi k&yacute; hợp đồng mua b&aacute;n). Sau đ&oacute;, mỗi th&aacute;ng sẽ đ&oacute;ng 1% cho đến khi nhận b&agrave;n giao (khoảng 19 đợt).<br />\r\n&nbsp;\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/screen-shot-2018-12-13-at-11.42.51-1024x766-1545291556.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Hausbelo%20Q9/screen-shot-2018-12-13-at-11.43.14-1024x878-1545291556.jpg\" style=\"max-width: 100%;\" /></p>\r\n<br />\r\n-&gt; L&agrave; dự &aacute;n c&oacute; mức thanh to&aacute;n nhẹ nh&agrave;ng nhất trong khu vực, ph&ugrave; hợp cho gia đ&igrave;nh trẻ v&agrave; nh&agrave; đầu tư.<br />\r\n<br />\r\nNgo&agrave;i phương thức thanh to&aacute;n 1%, qu&yacute; kh&aacute;ch h&agrave;ng cũng c&oacute; thể chọn phương thức thanh to&aacute;n chuẩn, hoặc phương thức thanh to&aacute;n nhanh để nhận được mức ưu đ&atilde;i từ CĐT.',NULL,0,1,0,12,'2018-12-20 11:30:40','2018-12-20 15:05:07',1,1),(13,'New Times City Nam Tân Uyên Bình Dương','new-times-city-nam-tan-uyen-binh-duong','new times city nam tan uyen binh duong','<ul>\r\n	<li>Vị tr&iacute;: Nằm giữa ba tuyến giao th&ocirc;ng huyết mạch gồm đại lộ Nam T&acirc;n Uy&ecirc;n, ĐT 747 v&agrave; đại lộ Uy&ecirc;n Hưng, thị&nbsp;x&atilde; T&acirc;n Uy&ecirc;n, tỉnh B&igrave;nh Dương</li>\r\n	<li>Quy m&ocirc;: 18,5ha</li>\r\n	<li>Chủ đầu tư: C&ocirc;ng ty TNHH Ho&agrave;ng H&ugrave;ng</li>\r\n	<li>Ph&acirc;n phối độc quyền: Tập đo&agrave;n Kim Oanh</li>\r\n	<li>Hạ tầng ho&agrave;n thiện: Đường nội khu 9-15 m&eacute;t (vỉa h&egrave; mỗi b&ecirc;n 5 m&eacute;t), điện &acirc;m, nước thủy cục, hệ thống nước&nbsp;mưa v&agrave; nước thải ri&ecirc;ng biệt, hệ thống th&ocirc;ng tin li&ecirc;n lạc, c&acirc;y xanh,&hellip;</li>\r\n	<li>Tiện &iacute;ch nội khu: Trường mầm non, c&ocirc;ng vi&ecirc;n, trung t&acirc;m thương mại &ndash; dịch vụ v&agrave; hồ cảnh quan</li>\r\n	<li>Tiện &iacute;ch li&ecirc;n kết: Chợ Hội Nghĩa, chợ T&acirc;n Uy&ecirc;n, khu c&ocirc;ng nghiệp Nam T&acirc;n Uy&ecirc;n, trường Tiểu học &ndash; THCS Hội&nbsp;</li>\r\n	<li>&nbsp;Nghĩa, Bệnh viện Đa khoa T&acirc;n Uy&ecirc;n&hellip;</li>\r\n	<li>Ph&aacute;p l&yacute;: Sổ đỏ ri&ecirc;ng từng nền (c&ocirc;ng chứng ra sổ ngay)</li>\r\n	<li>Gi&aacute; b&aacute;n: Chỉ từ 9 - 12 triệu/m2.</li>\r\n	<li>Diện t&iacute;ch: 1 l&ocirc; l&agrave; ngang 5m - d&agrave;i 20m. &nbsp; Tổng l&agrave; 100m2/nền</li>\r\n</ul>\r\n','Nắm giữ vị trí chiến lược ngay trung tâm thị xã Tân Uyên (tỉnh Bình Dương) và nằm trên hành lang phát triển kinh tế TPHCM – Tây Nguyên, liền kề thành phố mới Bình Dương, khu đô thị New Times City là không chỉ là nơi đáng để chọn lựa an cư mà còn là “đất vàng” để đầu tư bởi tiềm năng gia tăng giá trị mạnh mẽ theo thời gian.\r\n','Tel: 0938.399.647\r\nMs. Thu Hương ',NULL,77,'<p class=\"text-center\"><img src=\"/public/uploads/images/New%20Times%20City/vi-tri-tan-uyen-1560305085.jpg\" style=\"max-width: 100%;\" /></p>\r\n<br />\r\nNắm giữ vị tr&iacute; chiến lược ngay trung t&acirc;m thị x&atilde; T&acirc;n Uy&ecirc;n (tỉnh B&igrave;nh Dương) v&agrave; nằm tr&ecirc;n h&agrave;nh lang ph&aacute;t triển kinh tế TPHCM &ndash; T&acirc;y Nguy&ecirc;n, liền kề th&agrave;nh phố mới B&igrave;nh Dương, khu đ&ocirc; thị New Times City l&agrave; kh&ocirc;ng chỉ l&agrave; nơi đ&aacute;ng để chọn lựa an cư m&agrave; c&ograve;n l&agrave; &ldquo;đất v&agrave;ng&rdquo; để đầu tư bởi tiềm năng gia tăng gi&aacute; trị mạnh mẽ theo thời gian.<br />\r\n<br />\r\nNew Times City c&ograve;n mang đến tiềm năng khai th&aacute;c kinh doanh rất thuận lợi do gần kề với c&aacute;c khu c&ocirc;ng nghiệp lớn như Nam T&acirc;n Uy&ecirc;n, Uy&ecirc;n Hưng, VSIP II&hellip; Trong tương lai, khi khu c&ocirc;ng nghiệp VSIP III quy m&ocirc; 1.000 ha đi v&agrave;o hoạt động, sẽ thu h&uacute;t một lượng lớn lao động đến l&agrave;m việc, k&eacute;o theo nhu cầu lớn về nh&agrave; ở cũng như mặt bằng kinh doanh. Đ&acirc;y l&agrave; điều kiện thuận lợi để c&aacute;c chủ nh&acirc;n New Times City ph&aacute;t triển nhiều ng&agrave;nh nghề kinh doanh mang lại nguồn lợi nhuận hấp dẫn.<br />\r\nSắp tới, thị x&atilde; T&acirc;n Uy&ecirc;n c&ograve;n quy hoạch ph&aacute;t triển c&aacute;c khu du lịch sinh th&aacute;i kết hợp nghỉ dưỡng, bến thuyền, nh&agrave; h&agrave;ng, kh&aacute;ch sạn, trung t&acirc;m thương mại phủ khắp địa b&agrave;n. Tất cả sẽ mang đến cho c&aacute;c chủ nh&acirc;n New Times City một cơ hội hiếm c&oacute; để khởi sự kinh doanh, l&agrave;m chủ bản th&acirc;n.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;','<p class=\"text-center\"><img src=\"/public/uploads/images/New%20Times%20City/so-do-tien-ich-tan-uyen1-1560305067.jpg\" style=\"max-width: 100%;\" /></p>\r\n<strong>CHỐN AN CƯ TUYỆT VỜI</strong><br />\r\nNằm trong khu vực ph&aacute;t triển năng động của khu vực trung t&acirc;m thị x&atilde; T&acirc;n Uy&ecirc;n, New Times City được thừa hưởng mọi tiện &iacute;ch sẵn c&oacute; như chợ Hội Nghĩa, trường tiểu học &ndash; THCS Hội Nghĩa, Trung t&acirc;m thương mại Ho&agrave;ng Mai, Bệnh viện Đa khoa T&acirc;n Uy&ecirc;n, chợ T&acirc;n Uy&ecirc;n. Nội khu dự &aacute;n c&ograve;n t&iacute;ch hợp c&aacute;c tiện &iacute;ch như trường mầm non, c&ocirc;ng vi&ecirc;n, hồ cảnh quan, khu thương mại &ndash; dịch vụ&hellip; Nhờ đ&oacute;, cư d&acirc;n New Times City c&oacute; thể tận hưởng một cuộc sống tiện nghi nhất.<br />\r\n<br />\r\n<strong>KINH DOANH HIỆU QUẢ</strong><br />\r\n<br />\r\nNew Times City c&ograve;n mang đến tiềm năng khai th&aacute;c kinh doanh rất thuận lợi do gần kề với c&aacute;c khu c&ocirc;ng nghiệp lớn như Nam T&acirc;n Uy&ecirc;n, Uy&ecirc;n Hưng, VSIP II&hellip; Trong tương lai, khi khu c&ocirc;ng nghiệp VSIP III quy m&ocirc; 1.000 ha đi v&agrave;o hoạt động, sẽ thu h&uacute;t một lượng lớn lao động đến l&agrave;m việc, k&eacute;o theo nhu cầu lớn về nh&agrave; ở cũng như mặt bằng kinh doanh. Đ&acirc;y l&agrave; điều kiện thuận lợi để c&aacute;c chủ nh&acirc;n New Times City ph&aacute;t triển nhiều ng&agrave;nh nghề kinh doanh mang lại nguồn lợi nhuận hấp dẫn. Sắp tới, thị x&atilde; T&acirc;n Uy&ecirc;n c&ograve;n quy hoạch ph&aacute;t triển c&aacute;c khu du lịch sinh th&aacute;i kết hợp nghỉ dưỡng, bến thuyền, nh&agrave; h&agrave;ng, kh&aacute;ch sạn, trung t&acirc;m thương mại phủ khắp địa b&agrave;n. Tất cả sẽ mang đến cho c&aacute;c chủ nh&acirc;n New Times City một cơ hội hiếm c&oacute; để khởi sự kinh doanh, l&agrave;m chủ bản th&acirc;n.<br />\r\n<br />\r\n<strong>KHẢ NĂNG SINH LỜI VƯỢT TRỘI</strong><br />\r\n<br />\r\nT&iacute;nh đến nay, thị x&atilde; T&acirc;n Uy&ecirc;n đ&atilde; thu h&uacute;t hơn 1.440 doanh nghiệp trong v&agrave; ngo&agrave;i nước đến đầu tư sản xuất, kinh doanh. Điều n&agrave;y đ&atilde; g&oacute;p phần thay đổi bộ mặt đ&ocirc; thị T&acirc;n Uy&ecirc;n v&agrave; đưa gi&aacute; trị bất động sản tăng từ 30-50% so với năm 2017. Từ th&aacute;ng 11-2018, thị x&atilde; T&acirc;n Uy&ecirc;n đ&atilde; được c&ocirc;ng nhận l&agrave; đ&ocirc; thị loại III, tạo n&ecirc;n một c&uacute; h&iacute;ch tiếp tục l&agrave;m gia tăng g&aacute;i trị cho lĩnh vực bất động sản. Hiện thị x&atilde; T&acirc;n Uy&ecirc;n đang tiếp tục ph&aacute;t triển c&aacute;c lĩnh vực c&ocirc;ng nghiệp &ndash; dịch vụ, n&acirc;ng cấp hệ thống giao th&ocirc;ng, đầu tư th&ecirc;m c&aacute;c tiện &iacute;ch c&ocirc;ng cộng hướng đến mục ti&ecirc;u trở th&agrave;nh đ&ocirc; thị II v&agrave;o năm 2020. Như vậy, gi&aacute; trị bất động sản của New Times City chắc chắn sẽ gia tăng mạnh mẽ v&agrave; bền vững c&ugrave;ng với tốc độ ph&aacute;t triển của thị x&atilde; T&acirc;n Uy&ecirc;n.<br />\r\n<br />\r\n<strong>PH&Aacute;P L&Yacute; VỮNG CHẮC </strong><br />\r\n<br />\r\nVới quy m&ocirc; 18,5ha, New Times City được quy hoạch chỉn chu, hạ tầng đ&atilde; ho&agrave;n chỉnh với c&aacute;c tuyến đường trải nhựa rộng 9-15 m&eacute;t, hệ thống điện &acirc;m, nước thủy cục, th&ocirc;ng tin li&ecirc;n lạc, hệ thống tho&aacute;t nước mưa v&agrave; nước thải ri&ecirc;ng biệt. Đặc biệt, dự &aacute;n đ&atilde; c&oacute; sổ đỏ ri&ecirc;ng từng nền n&ecirc;n kh&aacute;ch h&agrave;ng c&oacute; thể x&acirc;y nh&agrave; ở ngay sau khi ho&agrave;n th&agrave;nh nghĩa vụ thanh to&aacute;n.<br />\r\n&nbsp;','<p class=\"text-center\"><img src=\"/public/uploads/images/New%20Times%20City/phan-lo-new-times-city-1560305067.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\">&nbsp;</p>\r\n','',NULL,0,1,0,13,'2019-06-12 09:07:33','2019-06-12 09:22:14',1,1),(14,'Aqua City Biên Hòa','aqua-city-bien-hoa','aqua city bien hoa','Được Ph&aacute;t Triển &nbsp;: Tập Đo&agrave;n NovaLand<br />\r\n<br />\r\nLoại h&igrave;nh đầu tư v&agrave; ph&aacute;t triển: Shophouse, Nh&agrave; phố liền kề, Biệt thự đơn lập, Biệt thự song lập.<br />\r\n<br />\r\nTiện &iacute;ch: C&ocirc;ng vi&ecirc;n ven s&ocirc;ng, trung t&acirc;m thương mại, bến du thuyền 5 sao, hệ thống trường học, khu thể thao trong nh&agrave; v&agrave; ngo&agrave;i trời&hellip;<br />\r\n<br />\r\nCơ sở ph&aacute;p l&yacute;: Sở hữu l&acirc;u d&agrave;i<br />\r\nThời điểm khởi c&ocirc;ng: 2019<br />\r\nThời điểm b&agrave;n giao dự kiến: 2023<br />\r\nTổng diện t&iacute;ch quy hoạch l&agrave; : 1800ha giai đoạn đầu 300ha<br />\r\nThời gian ph&aacute;t triển dự &aacute;n : Q&uacute;y 2/ 2019<br />\r\n<br />\r\nQuy m&ocirc; dự &aacute;n:<br />\r\n&ndash; Biệt thự đơn lập: 58 căn<br />\r\n&ndash; Biệt thự song lập: 82 căn<br />\r\n&ndash; Nh&agrave; phố 6&times;20: 15 căn<br />\r\n&ndash; Nh&agrave; phố 8&times;20: 375 căn<br />\r\n&ndash; Shophouse: 51 căn','Dự án Aqua City Novaland sở hữu vị trí đắc địa, chuẩn phong thủy được bao bọc bởi sông Đồng Nai và bầu không khí trong lành, tách biệt sự ồn ào đô thị. Bên cạnh đó đây còn là điểm giao của những tuyến đường huyết mạch nối dự án với các trung tâm kinh tế lớn phía Nam một cách hoàn hảo nhất.','Ms. Thu Hương 0938.399.647',NULL,81,'<p class=\"text-left\"><img src=\"/public/uploads/images/Aquacity/vi-tri-aqua-city-bien-hoa-1560479013.jpg\" style=\"max-width: 100%;\" /><br />\r\n<br />\r\nDự &aacute;n Aqua City của Novaland tọa lạc tr&ecirc;n Quốc lộ 51 đường V&agrave;nh Đai, cao tốc Bi&ecirc;n H&ograve;a &ndash; Vũng T&agrave;u, thuộc địa b&agrave;n x&atilde; Long Hưng, TP. Bi&ecirc;n H&ograve;a, Đồng Nai. Ngay trung t&acirc;m kết nối cửa ng&otilde; ph&iacute;a Đ&ocirc;ng TP. HCM với c&aacute;c tỉnh th&agrave;nh Nam bộ.<br />\r\nVới vị tr&iacute; trải d&agrave;i 20 km ven s&ocirc;ng Đồng Nai, kết nối trực tiếp Quận 9, Aqua City Bi&ecirc;n H&ograve;a hứa hẹn sẽ trở th&agrave;nh &ldquo;Kẻ đối đầu&rdquo; ho&agrave;n hảo với Đại đ&ocirc; thị Vincity.<br />\r\n<br />\r\nDự &aacute;n Aqua City Bi&ecirc;n H&ograve;a mang trong m&igrave;nh trọn vẹn 3 yếu tố thịnh vượng: &ldquo;Nhất cận thị, Nhị cận giang, Tam cận lộ&rdquo;. Đồng thời được nhận định nằm ở vị tr&iacute; si&ecirc;u chuẩn về phong thủy, với S&ocirc;ng Đồng Nai &ocirc;m trọn v&agrave; được bao bọc bởi h&agrave;ng loạt c&aacute;c cung đường trọn điểm của khu vực.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li class=\"text-left\">C&aacute;ch trung t&acirc;m TPHCM chỉ khoảng 15km</li>\r\n	<li class=\"text-left\">C&aacute;ch trung t&acirc;m Tp.Bi&ecirc;n H&ograve;a chỉ 6km</li>\r\n	<li class=\"text-left\">C&aacute;ch s&acirc;n bay quốc tế Long Th&agrave;nh chỉ 10 km&nbsp;</li>\r\n	<li class=\"text-left\">C&aacute;ch khu C&ocirc;ng nghệ cao quận 9 khoảng 8km</li>\r\n	<li class=\"text-left\">Gần s&aacute;t tuyển Metro Bến Th&agrave;nh &ndash; Bi&ecirc;n H&ograve;a với 1.5 km</li>\r\n	<li class=\"text-left\">C&aacute;ch khu c&ocirc;ng nghiệp Bi&ecirc;n H&ograve;a v&agrave; Ng&atilde; ba Vũng T&agrave;u lần lượt 3 km v&agrave; 2 km.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n','<p class=\"text-left\"><img src=\"/public/uploads/images/he-thong-tien-ich-aqua-city-bien-hoa-1560478664.jpg\" style=\"max-width: 100%;\" /><br />\r\n<br />\r\nYếu tố tiện &iacute;ch được đ&aacute;nh gi&aacute; l&agrave; một trong những ưu điểm của dự &aacute;n, g&oacute;p phần gia tăng tiềm năng nhờ trải nghiệm sống đẳng cấp. C&oacute; thể kể đến một số hạng mục tiện &iacute;ch nội khu trọng t&acirc;m:<br />\r\n<br />\r\nTrung t&acirc;m thương mại cao cấp, si&ecirc;u thị, cửa h&agrave;ng tiện &iacute;ch&hellip; thuận tiện cho nhu cầu mua sắm của cư d&acirc;n.<br />\r\nHệ thống trường học c&aacute;c cấp từ mầm non đến trung học phổ th&ocirc;ng ươm mầm, chắp c&aacute;nh cho sự ph&aacute;t triển tương lai con em cư d&acirc;n.<br />\r\nKhu vui chơi giải tr&iacute; d&agrave;nh cho trẻ em.<br />\r\nKh&ocirc;ng gian sinh hoạt cộng đồng.<br />\r\nKhu thể dục thể thao trong nh&agrave; v&agrave; hệ thống s&acirc;n tập ngo&agrave;i trời rộng tho&aacute;ng.<br />\r\nHồ điều h&ograve;a quy m&ocirc; lớn.<br />\r\nBến du thuyền thể hiện đẳng cấp thượng lưu.<br />\r\nC&ocirc;ng vi&ecirc;n ven s&ocirc;ng, c&ocirc;ng vi&ecirc;n nội khu, vườn hoa, đường dạo bộ với thảm thực vật xanh mướt mang lại m&ocirc;i trường sống trong l&agrave;nh, gần gũi thi&ecirc;n nhi&ecirc;n.<br />\r\nC&aacute;c chốt canh g&aacute;c ra v&agrave;o v&agrave; đội ngũ bảo vệ chuy&ecirc;n nghiệp đảm bảo an ninh khu d&acirc;n cư 24/24&hellip;<br />\r\n&nbsp;</p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aquacity/aqua-city-file-gi-1_page_05-1400x787-1560479012.jpg\" style=\"max-width: 100%;\" /><br />\r\n&nbsp;</p>\r\n\r\n<p>Ngo&agrave;i ra nhờ vị tr&iacute; thuận tiện, từ Aqua City dễ d&agrave;ng tiếp cận c&aacute;c tiện &iacute;ch ngoại khu nổi bật:</p>\r\n\r\n<ul>\r\n	<li>Du lịch tham quan: Khu du lịch Giang Điền, KDL C&ugrave; Lao Phố, KDL Sơn Ti&ecirc;n, KDL Suối Ti&ecirc;n&hellip;</li>\r\n	<li>Kinh tế: Khu c&ocirc;ng nghệ cao Quận 9, Khu c&ocirc;ng nghiệp Bi&ecirc;n H&ograve;a, KCN Amata, KCN Bắc Sơn, KCN Hố Nai&hellip;</li>\r\n	<li>Thể thao giải tr&iacute;: Big C, S&acirc;n Golf Long Th&agrave;nh&hellip;</li>\r\n	<li>Gi&aacute;o dục: L&agrave;ng Đại học Quốc Gia, hệ thống trường học c&aacute;c cấp từ mẫu gi&aacute;o đến THPT&hellip;</li>\r\n	<li>Y tế: Bệnh viện Quốc tế Shing Mark.</li>\r\n	<li>Giao th&ocirc;ng: Bến xe miền Đ&ocirc;ng mới, S&acirc;n bay Long Th&agrave;nh&hellip;</li>\r\n</ul>\r\n','<p class=\"text-center\"><img src=\"/public/uploads/images/Aquacity/mat-bang-giai-doan-1-aqua-city-bien-hoa-1560479868.jpg\" style=\"max-width: 100%;\" /></p>\r\nLấy cảm hứng từ bản sắc văn h&oacute;a v&ugrave;ng s&ocirc;ng nước Nam Bộ, dự &aacute;n sẽ mang đậm n&eacute;t đẹp bản địa, pha lẫn kiến tr&uacute;c hiện đại c&ugrave;ng chuỗi tiện &iacute;ch nội khu kh&eacute;p k&iacute;n ho&agrave;n thiện, cung cấp kh&ocirc;ng gian sống lịch l&atilde;m đ&aacute;ng gi&aacute;.<br />\r\nNgo&agrave;i ra, hệ thống xử l&yacute; nước thải, mạng lưới nước m&aacute;y, mạng lưới điện v&agrave; hệ thống tho&aacute;t nước tại Aqua City Bi&ecirc;n H&ograve;a được hạ ngầm dưới l&ograve;ng đất, đ&aacute;p ứng ti&ecirc;u chuẩn quốc tế về hạ tầng kỹ thuật, chất lượng sử dụng v&agrave; t&iacute;nh an to&agrave;n thực tế.','<div style=\"text-align: center;\"><br />\r\n<br />\r\n<span style=\"font-size:18px;\"><strong>CH&Iacute;NH S&Aacute;CH ƯU Đ&Atilde;I &ndash; GI&Aacute; B&Aacute;N AQUA CITY BI&Ecirc;N H&Ograve;A<br />\r\nGIAI ĐOẠN 1</strong></span></div>\r\n<br />\r\nMức gi&aacute; về cơ bản ph&ugrave; hợp với vị tr&iacute; v&agrave; c&aacute;c yếu tố tiện &iacute;ch, mặt bằng li&ecirc;n quan. Dự kiến, giai đoạn 1 của dự &aacute;n sẽ ho&agrave;n th&agrave;nh từ năm 2019 đến 2023. Hiện c&aacute;c hạng mục hạ tầng đang được đẩy nhanh tiến độ thi c&ocirc;ng, t&iacute;nh ph&aacute;p l&yacute; cũng đảm bảo an to&agrave;n để xuống tiền.<br />\r\n&nbsp;\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aquacity/gia-ban-aqua-city-bien-hoa-1560479013.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aquacity/csbh-aqua-city-bien-hoa-gd-1_1-1560479012.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p class=\"text-center\"><img src=\"/public/uploads/images/Aquacity/csbh-aqua-city-bien-hoa-gd-1_2-1560479013.jpg\" style=\"max-width: 100%;\" /></p>\r\n',NULL,0,1,0,14,'2019-06-14 09:17:53','2019-06-14 10:00:26',1,1),(15,'NovaWorld Phan Thiết Integrate Resort','novaworld-phan-thiet-integrate-resort','novaworld phan thiet integrate resort','<span style=\"color:#e74c3c;\"><strong>Dự &aacute;n NovaWorld Phan Thiết</strong></span> n&agrave;y được đ&aacute;nh gi&aacute; l&agrave; một &ldquo;Si&ecirc;u Phẩm&rdquo; vực dậy thị trường bất động sản Phan Thiết vốn rất tiềm năng. Novaworld Phan Thiết sẽ đ&aacute;nh dấu vị thế của Phan Thiết tr&ecirc;n bản đồ du lịch thế giới v&agrave; sẽ l&agrave; điểm đến nghĩ dưỡng tuyệt vời cho du kh&aacute;ch khi đến Phan Thiết trong tương lai.<br />\r\n<br />\r\nT&ecirc;n ch&iacute;nh thức: <strong>NovaWorld Phan Thiết Integrate Resort</strong><br />\r\nĐơn vị ph&aacute;t triển: Novaland<br />\r\nVị tr&iacute; dự &aacute;n: Lạc Long Qu&acirc;n, Tiến Th&agrave;nh, Th&agrave;nh phố Phan Thiết, B&igrave;nh Thuận<br />\r\nTổng diện t&iacute;ch: 1000 ha Loại h&igrave;nh đầu tư: Khu Resort &amp; Villas, kh&aacute;ch sạn. Condotel<br />\r\nPh&aacute;p l&yacute; dự &aacute;n: ho&agrave;n chỉnh<br />\r\nDự kiến ho&agrave;n th&agrave;nh: trong v&ograve;ng 10 năm<br />\r\nX&acirc;y dựng 1 trệt 1 lầu.<br />\r\n&nbsp;','NovaWorld Bình Thuận là quần thể nghỉ dưỡng du lịch giải trí đẳng cấp đa dạng sản phẩm như Shophouse, Biệt Thự View biển, Nhà Phố. Với Novaworld Tiến Thành, Tập đoàn Novaland một lần nữa khẳng định sự uy tín trên thương trường và tầm nhìn rộng lớn đối với phân khúc bất động sản nghỉ dưỡng ven biển.','Ms. Thu Hương 0938.399.647',NULL,84,'<p style=\"text-align:center\"><img src=\"/public/uploads/images/NovaWorld/74d2960a25a9c7f79eb8-1560493858.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<ul>\r\n	<li>NovaWorld Tiến Th&agrave;nh Phan Thiết l&agrave; dự &aacute;n mang t&iacute;nh ti&ecirc;n phong tr&ecirc;n nhiều kh&iacute;a cạnh: Phong c&aacute;ch kiến tr&uacute;c T&acirc;y Ban Nha, quy hoạch theo m&ocirc; h&igrave;nh Integrated Resort, vị tr&iacute; hiếm c&oacute; từ độ cao tọa lạc&hellip; Tất cả những yếu tố ti&ecirc;n phong n&agrave;y sẽ gi&uacute;p dự &aacute;n dẫn đầu thị trường bất động sản nghỉ dưỡng Phan Thiết.</li>\r\n	<li>Dự &aacute;n nằm tại vị tr&iacute; đắc địa, &ldquo;đủ gần v&agrave; đủ xa&rdquo; để bao trọn to&agrave;n bộ cảnh biển thơ mộng v&agrave; vẻ đẹp hiền h&ograve;a của th&agrave;nh phố Phan Thiết. Nơi m&agrave; Novaworld Tiến Th&agrave;nh tọa lạc c&ograve;n l&agrave; vị tr&iacute; c&oacute; cao độ hiếm c&oacute; trong khu vực Phan Thiết &ndash; B&igrave;nh Ch&acirc;u.</li>\r\n	<li>Khi c&aacute;c hạng mục giao th&ocirc;ng v&ugrave;ng ph&aacute;t triển, kết nối B&igrave;nh Thuận với những tỉnh th&agrave;nh kh&aacute;c, địa thế của dự &aacute;n lại c&agrave;ng đắc địa, mang đến tiềm năng tăng gi&aacute; cao, chưa kể khả năng khai th&aacute;c cho thu&ecirc; ph&ograve;ng lu&ocirc;n đạt đỉnh.</li>\r\n	<li>B&ecirc;n cạnh c&aacute;c tổ hợp lưu tr&uacute; với kiến tr&uacute;c đặc trưng từ nhiều quốc gia tr&ecirc;n thế giới, NovaWorld Phan Thiet sẽ x&acirc;y dựng cụm tiện &iacute;ch đẳng cấp quốc tế lần đầu ti&ecirc;n tại khu vực Phan Thiết như: trung t&acirc;m thể thao phức hợp khoảng 220ha bao gồm cụm s&acirc;n golf 36 lỗ theo ti&ecirc;u chuẩn quốc tế đủ điều kiện để đăng k&iacute; tổ chức giải PGA Tour (Hội golf thủ chuy&ecirc;n nghiệp), khu thi đấu thể thao trong nh&agrave;, ngo&agrave;i trời, s&acirc;n vận động, cụm c&ocirc;ng vi&ecirc;n chủ đề, c&ocirc;ng vi&ecirc;n nước; c&ocirc;ng vi&ecirc;n thiếu nhi.</li>\r\n	<li>Ngo&agrave;i ra, c&ograve;n c&oacute; khu phức hợp trung t&acirc;m thương mại &ndash; hội nghị &ndash; ẩm thực &ndash; giải tr&iacute; cho gia đ&igrave;nh; loạt kh&aacute;ch sạn 3-5 sao, kh&aacute;ch sạn Boutique; khu resort, International Clinic &ndash; spa (trung t&acirc;m chăm s&oacute;c sức khỏe, thẩm mỹ quốc tế)&hellip;</li>\r\n</ul>\r\n','<p style=\"text-align:center\"><img src=\"/public/uploads/images/NovaWorld/vi-tri-du-an-novaworld-phan-thiet-binh-thuan-1560494933.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p>Theo c&aacute;c chuy&ecirc;n gia, Novaworld Tiến Th&agrave;nh nằm tr&ecirc;n địa thế &ldquo;Tựa sơn hướng thủy&rdquo;, một mặt dựa v&agrave;o n&uacute;i một mặt hướng về biển, kh&ocirc;ng chỉ tốt về phong thủy m&agrave; c&ograve;n l&agrave;m du lịch rất thịnh vượng. H&igrave;nh dung một c&aacute;ch ch&acirc;n thực nhất, Novaworld được x&acirc;y dựng tr&ecirc;n cung đường &ldquo;Thủ phủ resort&rdquo; của B&igrave;nh Thuận, nơi Tinh hoa quy tụ về một mối. V&igrave; thế, tiềm năng m&agrave; dự &aacute;n đang c&oacute; sẽ l&agrave; lợi thế hấp dẫn h&agrave;ng đầu đối với giới đầu tư.<br />\r\n<br />\r\n&ndash; 10 ph&uacute;t &ndash; 15 ph&uacute;t di chuyển bằng xe từ Novaworld đến S&acirc;n bay quốc tế Phan Thiết.<br />\r\n<br />\r\n&ndash; Khoảng 10 ph&uacute;t di chuyển bằng xe từ Novaworld đến Cao tốc Dầu Gi&acirc;y Phan Thiết.<br />\r\n<br />\r\n&ndash; Dễ d&agrave;ng tham quan hơn 50 danh thắng nổi tiếng của B&igrave;nh Thuận chỉ từ 10-30 ph&uacute;t đi xe.<br />\r\n<br />\r\nTrong thời gian tới, khi c&aacute;c dự &aacute;n cơ sở hạ tầng giao th&ocirc;ng tại Phan Thiết ch&iacute;nh thức đi v&agrave;o hoạt động, việc di chuyển giữa Novaworld v&agrave; c&aacute;c th&agrave;nh phố lớn sẽ trở n&ecirc;n đơn giản hơn.&nbsp;<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img src=\"/public/uploads/images/NovaWorld/tien-ich-du-an-novaworld-phan-thiet-binh-thuan-1560495292.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p><strong>Một số tiện &iacute;ch nổi bật sẽ tạo n&ecirc;n điểm nhấn độc đ&aacute;o cho dự &aacute;n, c&oacute; thể kể đến:</strong></p>\r\n\r\n<ul>\r\n	<li>2 S&acirc;n Gofl Bikini Beach 18 lỗ, được Huyền thoại golf thế giới &ndash; Greg Norman &ndash; thiết kế v&agrave; quản l&yacute; thi c&ocirc;ng theo ti&ecirc;u chuẩn quốc tế.</li>\r\n	<li>S&acirc;n vận động Trung T&acirc;m Thể dục Thể thao, l&agrave; nơi tổ chức c&aacute;c sự kiện thể thao lớn của địa phương v&agrave; khu vực.</li>\r\n	<li>Trường Đấu La M&atilde;, Khu vui chơi giải tr&iacute;, Khu tr&ograve; chơi dưới nước, V&ograve;ng quay Khổng lồ tr&ecirc;n cao&hellip; cung cấp c&aacute;c tr&ograve; chơi vui nhộn, mạo hiểm.</li>\r\n	<li>Vườn th&uacute; Petting Zoo, Khu c&ocirc;ng vi&ecirc;n biển rộng 16 ha, C&ocirc;ng vi&ecirc;n nước, Cụm c&ocirc;ng vi&ecirc;n chủ đề&hellip; kh&ocirc;ng chỉ mang đến bầu kh&ocirc;ng kh&iacute; trong l&agrave;nh m&agrave; c&ograve;n dẫn dắt du kh&aacute;ch đến những miền thực vật tr&ugrave; ph&uacute; v&agrave; kỳ quan động vật nhiệt đới.</li>\r\n	<li>Bến du thuyền v&agrave; đường biển d&agrave;i 7km thơ mộng, l&agrave; nơi l&yacute; tưởng để thong dong dạo bộ v&agrave; tận hưởng cuộc sống thượng lưu&hellip;</li>\r\n</ul>\r\n','<strong>MẶT BẰNG QUY HOẠCH DỰ &Aacute;N NOVAWORLD TIẾN TH&Agrave;NH PHAN THIẾT</strong><br />\r\n<br />\r\nNovaworld được x&acirc;y dựng theo m&ocirc; h&igrave;nh Integrated Resort &ndash; Quần thể nghỉ dưỡng phức hợp đa chức năng theo quy chuẩn quốc tế, t&iacute;ch hợp Khu đ&ocirc; thị resort kiểu mới với đa dạng c&aacute;c loại h&igrave;nh lưu tr&uacute; v&agrave; h&agrave;ng loạt c&aacute;c loại h&igrave;nh vui chơi, giải tr&iacute; đẳng cấp.<br />\r\n&nbsp;\r\n<p style=\"text-align:center\"><img src=\"/public/uploads/images/NovaWorld/mat-bang-tong-the-novaworld-phan-thiet-giai-doan-1-1560495513.jpg\" style=\"max-width: 100%;\" /></p>\r\n\r\n<p>Theo chủ đầu tư, Novaworld Phan Thiết Tiến Th&agrave;nh Th&agrave;nh Phố Phan Thiết B&igrave;nh Thuận sẽ được thiết kế theo cảm hứng từ vẻ đẹp của Barcelona &ndash; Th&agrave;nh phố biển nổi tiếng h&agrave;ng đầu thế giới. Tận dụng địa thế n&uacute;i đồi, biển cả giao h&ograve;a, nh&agrave; thiết kế Novaworld đ&atilde; tạo n&ecirc;n một bức tranh sống động của dự &aacute;n, với m&agrave;u sắc thi&ecirc;n nhi&ecirc;n ch&acirc;n thực phối kết c&ugrave;ng vẻ đẹp tuyệt mỹ của kiến tr&uacute;c T&acirc;y Ban Nha.<br />\r\nTừng căn biệt thự, nh&agrave; phố tại Novaworld B&igrave;nh Thuận đều đậm chất T&acirc;y Ban Nha, thể hiện n&eacute;tph&oacute;ng kho&aacute;ng đặc trưng v&agrave; view nh&igrave;n hướng biển đắt gi&aacute;. Đ&acirc;y sẽ l&agrave; nơi an cư, nghỉ ngơi l&yacute; tưởng cho bất cứ vị kh&aacute;ch kh&oacute; t&iacute;nh n&agrave;o.</p>\r\n','<span style=\"font-size:18px;\"><strong>CH&Iacute;NH S&Aacute;CH &amp; BẢNG GI&Aacute; B&Aacute;N NOVAWORLD B&Igrave;NH THUẬN</strong></span><br />\r\nDự &aacute;n sẽ ch&iacute;nh thức mở b&aacute;n đợt 1 v&agrave;o ng&agrave;y 10/04/2019 (dự kiến). Ngay từ b&acirc;y giờ kh&aacute;ch h&agrave;ng đ&atilde; c&oacute; thể li&ecirc;n hệ đặt giữ chỗ trước để gia tăng cơ hội sở hữu những sản phẩm hot nhất trong dự &aacute;n.<br />\r\n<br />\r\nSau đ&acirc;y l&agrave; mức gi&aacute; tham khảo:<br />\r\n<br />\r\n&ndash; Diện t&iacute;ch 5 x 20m: Gi&aacute; 3.3 tỷ/căn &ndash; 3.9 tỷ/căn<br />\r\n<br />\r\n&ndash; Diện t&iacute;ch 6 x 24m: Gi&aacute; 4.5 tỷ/căn<br />\r\n<br />\r\n&ndash; Diện t&iacute;ch 8 x 20m: Gi&aacute; 4.9 tỷ/căn<br />\r\n<br />\r\n&ndash; Diện t&iacute;ch 10 x 20m: Gi&aacute; 5.5 tỷ/căn<br />\r\n<br />\r\n&ndash; Diện t&iacute;ch 12 x 20m: Gi&aacute; 6.5 tỷ/căn<br />\r\n&nbsp;\r\n<p style=\"text-align:center\"><img src=\"/public/uploads/images/NovaWorld/e49ae4d30f70ed2eb461-1560493858.jpg\" style=\"max-width: 100%;\" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n',NULL,0,1,0,15,'2019-06-14 13:21:34','2019-06-14 14:13:14',1,1);
/*!40000 ALTER TABLE `articles` ENABLE KEYS */;
UNLOCK TABLES;

